import React from 'react';
import { Component, Fragment } from 'react';
import { Container, Row, Col } from 'react-bootstrap';

class Chart extends Component {

    render(){
        return(
			<Fragment>
				<Container className="about">
					<Row>
					<div className="white-space"></div>
			            <div className="container">
			                <h2 className="heading-2">Technologies</h2>
			                <div className="about-list">
                            <div lg={4} md={6} sm={12} className="about-item">
			                        <p className="p-text">
			                            We are currently running efficient database of restaurant,so easily choose your area by zip code
			                        </p>
			                    </div>
                                <div></div>			                    <div lg={4} md={6} sm={12} className="about-item">
			                        <p className="p-text">
			                            We are currently running efficient database of restaurant,so easily choose your area by zip code
			                        </p>
			                    </div>
			                </div>
			            </div>
			            <div className="white-space"></div>

					</Row>
				</Container>
			</Fragment>
        )
    }


}

export default Chart;
